  methods: {
    updateInfo(value) {
      
      console.log("UPDATE INFO")
      console.log(value)
      this.title = value;
      this.region = value;
      this.isShowModal = true;
    },
    getInfo(e) {
      console.log(e.target.id, e.target.getAttribute("aria-valuetext"))
      this.title = e.target.id;
      this.region = e.target.getAttribute("aria-valuetext");
    },
    toggleModal(e) {
      if (e && e.target.getAttribute("aria-valuetext")) {
        this.regionMobile = e.target.getAttribute("aria-valuetext");
        this.isShowModal = !this.isShowModal;
      } else {
        this.isShowModal = !this.isShowModal;
      }
    },
    color(id) {
      switch (id) {
        case 1:
          return "indigo"
        case 2:
          return "blue"
        case 3:
          return "green"
        case 4:
          return "teal"
        case 5:
          return "yellow"
        case 6:
          return "red"
        case 7:
          return "gray"
        case 8:
          return "orange"
        case 9:
          return "purple"
        default:
          return "black"
          break;
      }
    },
    img(id) {
      switch (id) {
        case 1:
          return "indigo"
        case 2:
          return "blue"
        case 3:
          return "green"
        case 4:
          return "teal"
        case 5:
          return "yellow"
        case 6:
          return "red"
        case 7:
          return "gray"
        case 8:
          return "orange"
        case 9:
          return "purple"
        default:
          return "black"
          break;
      }
    },
  },
  async fetch() {
    this.loading = true;

    this.map = await this.$http.$get(
      "https://api.npoint.io/19d0bb44fe007ec4761b"
    );
    this.factions = await this.$http.$get(
      "https://api.npoint.io/19d0bb44fe007ec4761b/factions"
    ); //API
    this.loading = false;


    for (var key in this.map) {
      var obj = this.map[key];

      for (let prop in obj) {
        if (!obj.hasOwnProperty(prop)) continue;

        switch (obj[prop]) {
          case "#0bff00":
          case "#0BFF00":
            this.nbTerritoireRohan += 1;
            break;

          case "#00bfff":
          case "#00BFFF":
            this.nbTerritoireElfe += 1;
            break;

          case "#1e90ff":
          case "#1E90FF":
            this.nbTerritoireGondor += 1;
            break;

          case "#fffc00":
          case "#FFFC00":
            this.nbTerritoireNain += 1;
            break;

          case "#db5461":
          case "#DB5461":
            this.nbTerritoireMordor += 1;
            break;

          case "#ffffff":
          case "#FFFFFF":
            this.nbTerritoireIsengard += 1;
            break;

          case "#ff6f00":
          case "#FF6F00":
            this.nbTerritoireGobelin += 1;
            break;

          case "#c500ff":
          case "#C500FF":
            this.nbTerritoireAngmar += 1;
            break;
          default:
            break;
        }
      }

      if (obj.hasOwnProperty("players") && obj.players.length > 0) {
        let obj2 = JSON.parse(JSON.stringify(obj["players"]));
        for (var player in obj2) {
          switch (obj2[player]["factions"]) {
            case 1:
              this.nbPlayerElfe += 1;
              this.nbPlayers += 1;
              break;
            case 2:
              this.nbPlayerRohan += 1;
              this.nbPlayers += 1;
              break;
            case 3:
              this.nbPlayerGondor += 1;
              this.nbPlayers += 1;
              break;
            case 4:
              this.nbPlayerNain += 1;
              this.nbPlayers += 1;
              break;
            case 5:
              this.nbPlayerMordor += 1;
              this.nbPlayers += 1;
              break;
            case 6:
              this.nbPlayerIsengard += 1;
              this.nbPlayers += 1;
              break;
            case 7:
              this.nbPlayerGobelin += 1;
              this.nbPlayers += 1;
              break;
            case 8:
              this.nbPlayerAngmar += 1;
              this.nbPlayers += 1;
              break;
            default:
              break;
          }
        }
      }
    }
  },
  filters: {
    pourcentage: function (valeur, decimales) {
      if (decimales === undefined) {
        decimales = 2;
      }
      if (valeur === 0) {
        return "";
      }
      return (
        Math.round(valeur * Math.pow(10, decimales)) / Math.pow(10, decimales) +
        " %"
      );
    },
  },
};
